import React, { useEffect, useState } from 'react';
import { getLeads, deleteLead, updateLead } from '../api';

export default function LeadList({ refreshKey }) {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [q, setQ] = useState('');

  const fetch = async () => {
    try {
      setLoading(true);
      const res = await getLeads({ q });
      setLeads(res.data.data || res.data);
    } catch (err) {
      console.error(err);
    } finally { setLoading(false); }
  };

  useEffect(() => { fetch(); }, [refreshKey]);

  const remove = async (id) => {
    if (!window.confirm('Delete lead?')) return;
    await deleteLead(id);
    setLeads(leads.filter(l => l._id !== id));
  };

  const changeStatus = async (id, status) => {
    const res = await updateLead(id, { status });
    setLeads(leads.map(l => l._id === id ? res.data : l));
  };

  if (loading) return <div className="p-6 rounded-lg bg-white/90 shadow text-center">Loading...</div>;

  return (
    <div className="bg-white/90 backdrop-blur p-8 rounded-2xl shadow-xl border border-gray-200">
      <div className="flex gap-3 mb-5">
        <input
          placeholder="Search name/email/phone"
          value={q}
          onChange={e => setQ(e.target.value)}
          className="flex-grow p-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-green-400 bg-gray-50"
        />
        <button
          onClick={fetch}
          className="px-4 py-2 bg-green-500 hover:bg-green-600 rounded-md text-white font-semibold shadow transition"
        >
          Search
        </button>
      </div>
      <div className="overflow-x-auto">
        <table className="w-full text-sm border-separate border-spacing-y-2">
          <thead>
            <tr className="bg-gray-200 text-gray-700">
              <th className="p-3">Name</th>
              <th className="p-3">Email</th>
              <th className="p-3">Phone</th>
              <th className="p-3">Source</th>
              <th className="p-3">Status</th>
              <th className="p-3">Actions</th>
            </tr>
          </thead>
          <tbody>
            {leads.map((lead, i) => (
              <tr key={lead._id} className="bg-white hover:bg-blue-50 rounded-lg shadow-sm transition">
                <td className="p-3">{lead.name}</td>
                <td className="p-3">{lead.email}</td>
                <td className="p-3">{lead.phone}</td>
                <td className="p-3">{lead.source}</td>
                <td className="p-3">
                  <select
                    value={lead.status}
                    onChange={e => changeStatus(lead._id, e.target.value)}
                    className="rounded border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-400 p-1 bg-gray-50"
                  >
                    <option>New</option>
                    <option>Contacted</option>
                    <option>Qualified</option>
                  </select>
                </td>
                <td className="p-3">
                  <button
                    onClick={() => remove(lead._id)}
                    className="px-4 py-1 bg-red-500 hover:bg-red-600 rounded shadow text-white font-medium transition"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
            {leads.length === 0 && (
              <tr>
                <td colSpan={6} className="text-center text-gray-500 py-6">No leads found.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}
